import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';
import './index.css';

// function Title() {
//     return (
//         <div className='title'>
//             The Title
//         </div>
//     )
// }
function Title() {
    return (
        React.createElement(
            'div',
            { className: 'title' },
            'The Title'
        )
    )
}

function Author() {
    return (
        <div className='author'>
            The Author
        </div>
    )
}

function List() {
    return (
        <Fragment>
            <li className='rating'>
                5 star
            </li>
            <li className='isbn'>
                12-837777378
            </li>
        </Fragment>
    )
}

function MyThing() {
    return(
        <Fragment>
            <div className='book'>
                <Title/>
                <Author/>
                <ul className='stats'>
                    <List/>
                </ul>
            </div>
            <div>
                Newline
                Test
            </div>
            <div>
                Empty

                Newlines

                Here
            </div>
            <div>
                &nbsp;Non-breaking
                &nbsp;Space&nbsp;
            </div>
            <div>
                Line1
                {' '}
                Line2
            </div>
        </Fragment>
    )
}

ReactDOM.render(<MyThing/>, document.getElementById('root'));
